import {
    BrowserRouter,
    Routes,
    Route, Link
} from "react-router-dom";

import ArtView from './view/ArtView'
import CreateView from './view/CreateView'
import MyView from './view/MyView'
// src/pages/index.js를 통해서 한번에 import 할 수 있도록 함

function MainPage() {
    return (
        <BrowserRouter>
            {/*tab*/}
            <ul>
                <Link to = "/main/art">
                    <li>Art</li>
                </Link>

                <Link to = "/main/my">
                    <li>My</li>
                </Link>

                <Link to = "/main/create">
                    <li>Create</li>
                </Link>
            </ul>

            <Routes>
                <Route path="/main/art" element={<ArtView/>}/>
                <Route path="/main/my" element={<MyView/>}/>
                <Route path="/main/create" element={<CreateView/>}/>
                {/*<Route exact path="/info" render={() => <Info userInfo={userInfo} />} />*/}

            </Routes>

        </BrowserRouter>
    );
}

export default MainPage;
